-- Trigger: productName
CREATE TRIGGER IF NOT EXISTS productName
                      BEFORE INSERT
                          ON Products
                    FOR EACH ROW
BEGIN
    UPDATE Products
       SET ProductName = UPPER(SUBSTR(NEW.ProductName, 1, 1) ) || LOWER(SUBSTR(NEW.ProductName, 2) ) 
     WHERE ProductID = NEW.ProductID;
END;


